            selector: 'page-gnrfdf-giff-alimentation',template:/*ion-inline-start:"D:\Documents\Apply\mementoSP\src\pages\gnrfdf-giff-alimentation\gnrfdf-giff-alimentation.html"*/'<!--\n\n  Generated template for the GnrfdfGiffAlimentationPage page.\n\n\n\n  See http://ionicframework.com/docs/components/#navigation for more info on\n\n  Ionic pages and navigation.\n\n-->\n\n<ion-header>\n\n\n\n  <ion-navbar>\n\n    <ion-title>MANOEUVRES FEUX DE FORÊTS</ion-title>\n\n    <ion-buttons end >\n\n        <header-menu></header-menu>\n\n      </ion-buttons>\n\n  </ion-navbar>\n\n\n\n</ion-header>\n\n\n\n\n\n<ion-content padding>\n\n\n\n<h3 class="titre-categorie-gnr">MANOEUVRES DU GIFF</h3>\n\n\n\n<img src="assets/icon/Capture54.PNG" alt="" />\n\n\n\n<h4 class="Style1">MANOEUVRES D’ALIMENTATION DES CITERNES DES CCF DU GIFF</h4>\n\n\n\n<h5>Alimentation simultanée de 2 CCF</h5>\n\n\n\n<p>Dans certains cas, 2 CCF doivent remplir simultanément leur citerne sur le même poteau ou\n\nbouche d’incendie. Chaque conducteur déroule un tuyau Ø 70mm / 20 m et alimente son\n\nvéhicule par l’entrée latérale de la citerne.</p>\n\n\n\n<p><img src="assets/icon/Capture69.PNG" alt="" /><strong>Alimentation simultanée de 2 CCF</strong></p>\n\n\n\n<h5>Alimentation simultanée de 4 CCF sur un poteau ou une bouche d’incendie</h5>\n\n\n\n<p>Chaque conducteur déroule un tuyau de Ø 45 mm. Les 4 CCF sont alimentés en simultané sur\n\nl’entrée latérale de leur citerne.</p>\n\n\n\n<p><strong>Commandement du chef du GIFF : « Alimentation des 4 CCF sur le poteau ou sur la bouche d’incendie »</strong></p>\n\n\n\n<img src="assets/icon/Capture70.PNG" alt="" />\n\n\n\n<p class="Style1">La manoeuvre peut s’effectuer, en fonction du type d’hydrant, avec des tuyaux de Ø 70 mm.</p>\n\n\n\n<p><img src="assets/icon/Capture71.PNG" alt="" /><strong>Alimentation simultanée de 4 CCF sur un poteau ou une bouche d’incendie</strong></p>\n\n\n\n<h5>ALIMENTATION SIMULTANÉE DE 4 CFF SUR UN POINT D’EAU NATUREL OU ARTIFICIEL</h5>\n\n\n\n<p>L’alimentation sur point d’eau peut être réalisée soit par la mise en aspiration d’un CCF ou par\n\ntout autre dispositif (motopompe remorquable, motopompe flottante ou immergée, etc).</p>\n\n\n\n<p><img src="assets/icon/Capture72.PNG" alt="" /><strong>Exemple d’alimentation simultanée de 4 CCF sur un point d’eau naturel ou artificiel</strong></p><br>\n\n\n\n</ion-content>\n\n'/*ion-inline-end:"D:\Documents\Apply\mementoSP\src\pages\gnrfdf-giff-alimentation\gnrfdf-giff-alimentation.html"*/,
