            selector: 'page-gnrfdf-giff-defensives',template:/*ion-inline-start:"D:\Documents\Apply\mementoSP\src\pages\gnrfdf-giff-defensives\gnrfdf-giff-defensives.html"*/'<!--\n\n  Generated template for the GnrfdfGiffDefensivesPage page.\n\n\n\n  See http://ionicframework.com/docs/components/#navigation for more info on\n\n  Ionic pages and navigation.\n\n-->\n\n<ion-header>\n\n\n\n  <ion-navbar>\n\n    <ion-title>MANOEUVRES FEUX DE FORÊTS</ion-title>\n\n    <ion-buttons end >\n\n        <header-menu></header-menu>\n\n      </ion-buttons>\n\n  </ion-navbar>\n\n\n\n</ion-header>\n\n\n\n\n\n<ion-content padding>\n\n\n\n<h3 class="titre-categorie-gnr">MANOEUVRES DU GIFF</h3>\n\n\n\n<img src="assets/icon/Capture54.PNG" alt="" />\n\n\n\n<h4 class="Style1">MANOEUVRES DÉFENSIVES</h4>\n\n\n\n<p>Dans le cadre des manoeuvres défensives, le GIFF prend une position permettant d’attendre le\n\nfeu et de mener une attaque dès son approche.</p>\n\n\n\n<p>Il existe 2 types de manoeuvres défensives :</p>\n\n\n\n<li>La protection des points sensibles</li>\n\n<li>L’établissement d’une ligne d’appui</li>\n\n\n\n<h5>Protection des points sensibles</h5>\n\n\n\n<p>Les points sensibles peuvent être des habitations, des relais hertziens, des stations de\n\ncompression de gaz, des établissements industriels ou recevant du public, etc.</p>\n\n\n\n<p>En fonction des risques, le chef du GIFF adapte sa manoeuvre à la situation rencontrée. Il\n\napplique et fait appliquer les mesures de sécurité, les actions à réaliser peuvent être :</p>\n\n\n\n<li>Le confinement de la population</li>\n\n<li>L’évacuation partielle ou totale de la population</li>\n\n<li>La fermeture des portes et des volets</li>\n\n<li>La vérification de l’état de la toiture</li>\n\n<li>La recherche des locaux à risque et sources d’énergie</li>\n\n<li>La recherche des points d’eau éventuels</li>\n\n<li>L’établissement des lances</li>\n\n<li>Etc</li>\n\n\n\n<h5>Réalisation d’une ligne d’appui</h5>\n\n\n\n<p>La ligne d’appui peut être statique ou dynamique.</p>\n\n\n\n<p><u><strong>Ligne d’appui statique</strong></u></p>\n\n\n\n<p>Les véhicules se placent sur un des côtés de la piste en laissant le libre passage. Ils se garent\n\ntous les 20 m maximum. Chaque CCF établit une lance 500 minimum. L’ouverture des lances\n\nse fait sur ordre du chef du GIFF.</p>\n\n\n\n<p class="Style1">Le chef du GIFF veille à laisser une <strong>zone de sécurité</strong> entre les engins et le\n\nfront de feu.</p>\n\n\n\n<p><strong>Commandement du chef du GIFF : « Pour l’exécution d’une ligne d’appui stationnement des véhicules à droite (à gauche) tous les X\n\nm, établissez … ».</strong></p>\n\n\n\n<p class="center"><strong>Manoeuvre effectuée par chaque CCF</strong></p>\n\n\n\n<img src="assets/icon/Capture66.PNG" alt="" /><br>\n\n\n\n<p><img src="assets/icon/Capture67.PNG" alt="" /><strong>Réalisation d’une ligne d’appui statique</strong></p>\n\n\n\n<p><u><strong>Ligne d’appui dynamique</strong></u></p>\n\n\n\n<p>Lors de la réalisation d’une ligne d’appui dynamique, le GIFF conserve sa mobilité tout en\n\neffectuant une attaque en mouvement au moyen de lances 500 minimum ou canons actionnés\n\ndepuis les CCF.</p>\n\n\n\n<p><img src="assets/icon/Capture68.PNG" alt="" /><strong>Réalisation d’une ligne d’appui dynamique avec des lances 500 ou des canons</strong></p>\n\n\n\n\n\n</ion-content>\n\n'/*ion-inline-end:"D:\Documents\Apply\mementoSP\src\pages\gnrfdf-giff-defensives\gnrfdf-giff-defensives.html"*/,
