            selector: 'page-gnrfdf-mesures-auto',template:/*ion-inline-start:"D:\Documents\Apply\mementoSP\src\pages\gnrfdf-mesures-auto\gnrfdf-mesures-auto.html"*/'<!--\n\n  Generated template for the GnrfdfMesuresAutoPage page.\n\n\n\n  See http://ionicframework.com/docs/components/#navigation for more info on\n\n  Ionic pages and navigation.\n\n-->\n\n<ion-header>\n\n\n\n  <ion-navbar>\n\n    <ion-title>MANOEUVRES FEUX DE FORÊTS</ion-title>\n\n    <ion-buttons end >\n\n        <header-menu></header-menu>\n\n      </ion-buttons>\n\n  </ion-navbar>\n\n\n\n</ion-header>\n\n\n\n\n\n<ion-content padding>\n\n\n\n<h3 class="titre-categorie-gnr">MESURES DE SÉCURITÉ, D’AUTOPROTECTION ET D’AUTODÉFENSE</h3>\n\n\n\n<h4 class="Style1">MESURES D’AUTOPROTECTION ET D’AUTODÉFENSE</h4>\n\n\n\n<img src="assets/icon/Capture22.PNG" alt="" />\n\n\n\n<p class="Style1">Les mesures d’autoprotection et d’autodéfense sont un ensemble d’actions à\n\nréaliser en situation d’urgence, lorsque tout repli est impossible, <strong>visant à\n\nprotéger les personnels en cas de situation défavorable</strong> mettant en jeu leur sécurité physique.</p>\n\n\n\n<h5>Définitions</h5>\n\n\n\n<li><strong>Autoprotection :</strong>déclenchement des dispositifs de protection d’un CCF équipé\n\nconformément à la norme en vigueur à la date de parution du présent guide</li><br>\n\n\n\n<li><strong>Autodéfense :</strong>mise en oeuvre d’un dispositif de sécurité intégrant notamment le\n\npositionnement des véhicules, l’autoprotection des CCF pour les engins en étant équipés\n\net éventuellement l’utilisation de moyens hydrauliques (lances, canon, etc.). Elle peut\n\nêtre <strong>active</strong> (utilisation de moyens hydrauliques) ou <strong>passive</strong> (sans utilisation de moyens hydrauliques).</li><br>\n\n\n\n<h5>Autoprotection du CCF</h5>\n\n\n\n<p>Lorsque le personnel est directement menacé par le feu, le chef d’agrès doit, en tenant compte de la situation :</p>\n\n\n\n<li>Anticiper les actions à réaliser</li>\n\n<li>Faire fermer les vannes d’aspiration et de refoulement si nécessaire</li>\n\n<li>Regrouper les personnels dans le CCF</li>\n\n<li>Faire mettre en oeuvre l’autoprotection du CCF</li>\n\n<li>Alerter sa hiérarchie de sa situation</li>\n\n<li>Demander des renforts terrestres et/ou aériens (largages de sécurité)</li>\n\n<li>Prévenir tout mouvement de panique</li>\n\n<li>Tâcher de maintenir le contact radio avec l’échelon hiérarchique supérieur sur le canal radio approprié</li><br>\n\n\n\n<h5>Autodéfense du GIFF</h5>\n\n\n\n<p>La mise en place du dispositif est effectuée dans les plus brefs délais et par mesure de sécurité,\n\nsi possible en une seule manoeuvre pour les véhicules.</p>\n\n\n\n<p class="Style1">Lorsque le terrain et le délai de mise en place le permettent, les véhicules sont\n\npositionnés de façon à protéger les cabines du flux thermique. <strong>Si le GIFF\n\ncomprend un CCF de classe S, celui-ci est privilégié pour être utilisé comme écran.</strong></p><br>\n\n\n\n<p class="Style1">Le chef de groupe <strong>doit adapter son dispositif de défense à la situation du\n\nmoment</strong>. Il l’indique aux personnels et s’assure de leur bonne compréhension de celui-ci, afin d’en garantir l’efficacité.</p><br>\n\n\n\n<p>Lors de la phase préalable à l’autodéfense, il doit :</p>\n\n\n\n<li>Anticiper sur l’évolution du feu pour manoeuvrer</li>\n\n<li>Faire évacuer la zone dangereuse</li>\n\n<li>Tâcher de maintenir le contact radio</li>\n\n<li>Alerter de sa situation l’échelon hiérarchique supérieur sur le canal approprié</li>\n\n<li>Choisir la zone qui offre le plus de sécurité</li>\n\n<li>Resserrer son dispositif, la VLTT étant placée de préférence entre les CCF, sans bloquer les accès aux cabines des véhicules</li>\n\n<li>Rassembler les équipages sur les points de défense qui paraissent offrir le meilleur abri (au centre du dispositif ou dans les cabines)</li>\n\n<li>Prévenir tout mouvement de panique</li>\n\n<li>Demander des renforts (terrestres et /ou aériens (largages de sécurité))</li><br>\n\n\n\n<p>Lorsque le personnel est directement menacé par le feu, il doit en fonction de la situation :</p>\n\n\n\n<li>Anticiper les actions à réaliser</li>\n\n<li>Regrouper les personnels non employés dans les CCF</li>\n\n<li>Faire mettre en oeuvre l’autoprotection des véhicules</li>\n\n<li>Faire mettre en oeuvre les moyens hydrauliques qu’il juge adaptés en fonction de la\n\nsituation et en prenant en compte la réserve en eau disponible (le canon ou 1 lance 1000\n\nl et 2 queues de paon ou 2 lances 500, une ou des lances 500 devant les véhicules pour compléter la protection, etc.)</li>\n\n<li>Commander, au moment le plus judicieux, la mise en oeuvre de l’autoprotection des véhicules et, en fonction de la réserve en eau, des lances</li>\n\n<li>Prévoir tout mouvement de panique</li>\n\n<li>Faire le bilan de la situation</li>\n\n<li>Rendre compte</li>\n\n<li>Tâcher de maintenir le contact radio avec l’échelon hiérarchique supérieur</li><br>\n\n\n\n<p>Les chefs d’agrès doivent :</p>\n\n\n\n<li>Faire établir les lances sur ordre</li>\n\n<li>Veiller la radio</li>\n\n<li>Appliquer les consignes de sécurité établies pour les CCF isolés</li><br>\n\n\n\n<p>Lorsque le terrain et le délai de mise en place ne permettent pas de regroupement adapté,\n\nl’autodéfense du groupe peut être réalisée avec les véhicules en colonne.</p>\n\n\n\n<p>Les exemples d’autodéfense du GIFF présentés ci-après représentent des CCF disposant d’une\n\nautoprotection. Dans le cas contraire, il appartient au chef du groupe d’adapter son dispositif\n\nd’autodéfense en fonction de la situation et des véhicules mis en oeuvre.</p>\n\n\n\n<h5>Exemples d’autodéfense active du GIFF</h5>\n\n\n\n<p>Le groupe a la possibilité et le temps de mettre en oeuvre des moyens hydrauliques : utilisation\n\ndu canon et établissements de lances 500, en fonction de la réserve hydraulique du GIFF.</p><br>\n\n\n\n<p><img src="assets/icon/Capture23.PNG" alt="" /><strong>Autodéfense active du GIFF avec utilisation du canon et de lances 500</strong></p><br>\n\n\n\n<p><img src="assets/icon/Capture24.PNG" alt="" /><strong>Autodéfense active du GIFF avec utilisation du canon et des lances en attente</strong></p><br>\n\n\n\n<h5>Exemples d’autodéfense passive du GIFF</h5>\n\n\n\n<p>Le groupe n’a plus suffisamment d’eau et/ou de temps pour mettre des moyens hydrauliques (lances, canon, etc.) en oeuvre.</p>\n\n\n\n<p><img src="assets/icon/Capture25.PNG" alt="" /><strong>Autodéfense passive du GIFF avec CCFS</strong></p><br>\n\n\n\n<p><img src="assets/icon/Capture26.PNG" alt="" /><strong>Autodéfense passive du GIFF avec CCFM</strong></p><br>\n\n\n\n<p><img src="assets/icon/Capture27.PNG" alt="" /><strong>Autodéfense passive du GIFF avec CCFM</strong></p><br>\n\n\n\n<p><img src="assets/icon/Capture28.PNG" alt="" /><strong>Autodéfense passive du GIFF avec CCFM en colonne</strong></p><br>\n\n\n\n<h5>Autodéfense de l’UIFF et de l’ULIFF</h5>\n\n\n\n<p>Lors de l’autodéfense de l’UIFF et de l’ULIFF, le chef d’agrès applique la même méthodologie que pour l’autodéfense du GIFF.</p>\n\n\n\n<h5>Largage de sécurité</h5>\n\n\n\n<p class="Style1">Un <strong>largage de sécurité</strong> est un largage effectué délibérément sur un véhicule\n\nou un groupe en difficulté pour faire tomber les flammes et la température afin de permettre au personnel de se dégager.</p><br>\n\n\n\n</ion-content>\n\n'/*ion-inline-end:"D:\Documents\Apply\mementoSP\src\pages\gnrfdf-mesures-auto\gnrfdf-mesures-auto.html"*/,
